// Promise.prototype.finally
Promise.prototype.finally = function(callback) {
  // Promise
  const P = this.constructor;
  return this.then((value) => {
    return P.resolve(callback()).then(() => {
      return value;
    })
  }, (reason) => {
    return P.resolve(callback()).then(() => {
      throw reason;
    })
  })
}

// quickSort
// 找一个基准点，比基准点小的放一个数组，比基准点大的放另一个数组。
// [1, 3, 2, 9, 6, 5, 1, 0, -2, 10]
function quickSorthelper(ary) {
  const { floor, random } = Math;
  if (ary.length <= 1) return ary;
  // 随机找一个基准点
  let pointIndex = floor(random() * ary.length);
  let pointValue = ary[pointIndex];
  let bigger = [];
  let smaller = [];
  ary.forEach((item, index) => {
    if (index !== pointIndex) {
      if (item <= pointValue) {
        smaller.push(item);
      } else {
        bigger.push(item);
      }
    }
  });

  return [...quickSorthelper(smaller), pointValue, ...quickSorthelper(bigger)];
}
function quickSort(ary) {
  return quickSorthelper(ary);
}

// mergeSort
// 将数组一分为2逐个比较
// [1, 3, 2, 9, 6, 5, 1, 0, -2, 10]
function mergeSortHelper(left, right) {
  let res = [];
  while (left.length && right.length) {
    let left0 = left[0];
    let right0 = right[0];
    if (left0 <= right0) {
      res.push(left.shift());
    } else {
      res.push(right.shift());
    }
  }

  return res.concat(left).concat(right);
}
function mergeSort(ary) {
  if (ary.length <= 1) return ary;
  let mid = Math.floor(ary.length / 2);
  return mergeSortHelper(
    mergeSort(ary.slice(0, mid)),
    mergeSort(ary.slice(mid))
  );
}

// heapSort
// 大根堆
function heapSort(arr) {
  let len = arr.length;
  // 交互
  function swap(i, j) {
    let temp = arr[i];
    arr[i] = arr[j];
    arr[j] = temp;
  }
  // 调整堆
  function maxHeapify(start, end) {
    let dad = start;
    // 左孩子为 start * 2 + 1；右孩子为 start * 2 + 2；
    let son = start * 2 + 1;
    // 做孩子不能越界
    if (son >= end) return;
    // 右孩子也不能越界且左孩子小于右孩子
    if (son + 1 < end && arr[son] < arr[son + 1]) {
      son++;
    }
    // 若有孩子大于父节点则交换且调整堆
    if (arr[dad] <= arr[son]) {
      swap(dad, son);
      maxHeapify(son, end);
    }
  }
  // 处理父节点的顺序
  for (let i = Math.floor(len / 2) - 1; i >= 0; i--) {
    maxHeapify(i, len);
  }
  // 根据父节点和叶子节点的大小对比，进行堆的调整
  for (let j = len - 1; j > 0; j--) {
    swap(0, j);
    maxHeapify(0, j);
  }
  return arr;
}
